import React from "react";
import { useDispatch} from "react-redux";
import { Link } from "react-router-dom";
import { clearFilters, clearSearch} from "../../redux/actions";
import logo from "../../images/favicon2.png";

const Header = () => {
  const dispatch = useDispatch();

  const handleClearSearchAndFilters = () => {
    dispatch(clearSearch());
    dispatch(clearFilters());
  };

  return (
    <header>
      <div className="header-container">
      <div className="logo-container">
  <img src={logo} alt="Dog App logo" className="logo-image" />
  <Link to="/home" onClick={handleClearSearchAndFilters}>
    <h1 className="logo-text">Henry Dogs Store</h1>
  </Link>
</div>
      </div>
    </header>
  );
};

export default Header;
